import React from 'react';
import './Home.css';
import NavBar from "../../components/NavBar/NavBar";

export default class Home extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            texts: [{
                text: "ABOBUS ABOBUS ABOBUS",
            }],
            title: "Virtual closet",
        };
    }

    render() {
        const title = this.state.title.slice();
        const texts = this.state.texts.slice();
        return (
            <div className="home">
                <NavBar/>
                <DescriptionBlock
                    title={title}
                    texts={texts}
                />
            </div>
        )
    }
}


function DescriptionBlock(props) {
    return (
        <div className="description-block">
            <div className="header">
                {props.title}
            </div>
            <div className="description">
                <TextBlock text={props.texts[0].text}/>
                <Delimeter/>

                <TextBlock text={props.texts[1].text}/>
                <Delimeter/>

                <TextBlock text={props.texts[2].text}/>
            </div>
        </div>
    );
}

function TextBlock(props) {
    return (
        <div className="text-block">
            {props.text}
        </div>
    );
}

function Delimeter() {
    return (
        <div className="delimeter">
        </div>
    );
}
